import './styles.scss'
import useGetData from '../../../hooks/useGetData';

import BgNumber from '../BgNumber';
import FieldTitle from "../FieldTitle";

const UserDetailes = () => {
    let params = useParams();
    console.log(params.userId);

    const {data, error, loading} = useGetData(`https://jsonplaceholder.typicode.com/users/${params.userId}`);
    console.log(data)
    const {
        name, id, username, email, phone, website, 
        company: {name: companyName}, 
        address: {street, suite, city, zipcode}} = data
    return (
         <main>

            <div className="d-flex">
            <h2 key={id}>{name}</h2>
                <div className='detailes'>

                <BgNumber id = {data.id}/>
                    <p><FieldTitle title="Username" />{username}</p> 
                    <p><FieldTitle title="Email" />{email}</p>
                    <p><FieldTitle title="Phone" />{phone}</p> 
                    <p><FieldTitle title="Website" />{website}</p> 
                    {/* <p><FieldTitle title="Company" />{companyName}</p>  */}
                    {/* <p><FieldTitle title="Address" />{data.address.street}, {data.address.suite}, {data.adress.city}</p>  */}
            </div>
            </div>

    </main>
)}

export default UserDetailes;
